import React from "react";

export default function Profile(props) {

  const profilePicture = <img src="https://cdn-icons-png.flaticon.com/512/2335/2335153.png" alt="girl-profile"></img>

  return (
   <header>
     <div class="profile-picture">{profilePicture}</div>
     <h1>Welcome user</h1>
     <p>Stats</p>
     <p>You have ran 10 runs.
     For a total of 100 minutes and 100 km.</p>
   </header>
  )
}
